export const login = (email) => ({
	type: 'LOGIN_EMAIL',
	payload: email,
});
export const logout = userEmail => ({
	type: 'LOGOUT_USER',
});

export const register = ( userEmail ) => ({
	type: 'IS_REGISTERED',
	payload: email,
});

export const searchData = (data) => ({
	type: 'SEARCH_DATA',
	payload: data,	
});
